import React from 'react';
import EmojiSection from '../components/EmojiSection';

function Home() {
  return (
    <div
      className="flex flex-col items-center p-8 min-h-screen bg-cover bg-center"
      style={{ backgroundImage: "url('/images/home-bg.jpg')" }}
    >
      <h2 className="text-4xl font-bold mb-6 text-white">Welcome! Choose Your Emotion:</h2>
      <EmojiSection />
    </div>
  );
}

export default Home;
